import React, { useState } from "react";
import { useContext, useEffect } from "react";

import { StyleSheet, Text, View, Button } from "react-native";

import TextItem1 from "../components/TextItem1";
import TextItem2 from "../components/TextItem2";

import { DataContext } from "./../App";

export default function Market({ navigation }) {
  const { DataList1, DataList2 } = useContext(DataContext);
  return (
    <View style={styles.container}>
      <View style={styles.marketSection}>
        {DataList1.map((text1, index) => (
          <TextItem1
            key={index}
            text1={text1.text1}
            dataDemand1={text1.dataDemand1}
            price1={text1.price1}
          />
        ))}
        {DataList2.map((text2, index) => (
          <TextItem1
            key={index}
            text2={text2.text2}
            dataDemand2={text2.dataDemand2}
            price2={text2.price2}
          />
        ))}
      </View>
      <View style={styles.categoriesSection}></View>
      <View style={styles.activitiesSection}></View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    alignItems: "center",
    justifyContent: "center",
    flexDirection: "row",
    backgroundColor: "#FFFFFF",
    width: "100%",
    height: "100%",
  },

  //   Market section
  marketSection: {
    flex: 8,
    width: "100%",
    height: "100%",
    backgroundColor: "#FFFFFF",
    flexDirection: "column",
    padding: 40,
  },

  // Categories section
  categoriesSection: {
    flex: 6,
    width: "100%",
    height: "100%",
    marginLeft: 20,
    backgroundColor: "#EFF5FD",
    flexDirection: "column",
    paddingLeft: 40,
    paddingTop: 40,
    paddingBottom: 40,
  },

  //Activities section
  activitiesSection: {
    flex: 6,
    width: "100%",
    height: "100%",
    backgroundColor: "#E0EEFF",
    flexDirection: "column",
    paddingTop: 40,
    paddingBottom: 40,
  },
});
